import React, { useState } from "react";
import Button from "../components/common/button";
import Textfield from "../components/common/textfield";
import NativeSelect from "../components/Select";
import Link from "../components/common/link";
function Signup() {
  const [Role, setRole] = useState(null);

  let rolechange = (data) => {
    setRole(data);
  };

  let signupHandle = (e) => {
    e.preventdefault();
    console.log("Signup Enter");
    let name = document.getElementById("name").value;
    let email = document.getElementById("email").value;
    let password = document.getElementById("password").value;
    let confirmPassword = document.getElementById("confirmPassword").value;
    let Roles = Role;
    console.log(Roles, "111111111");
    console.log(name, "22222");
    console.log(email, "3333333");
    if (password !== confirmPassword) {
      alert("Password not matched");
    } else {
      let userArr = [];
      let localUserArr = localStorage.getItem("userArr");
      if (localUserArr) {
        userArr = JSON.parse(localUserArr);
      }else{
        let newUser = {
          name: name,
          email: email,
          password: password,
          role: Role,
        };
        userArr.push(newUser);
        localStorage.setItem("userArr", JSON.stringify(userArr));

        alert("New User Added");
      }
    }
  };

  return (
    <div>
      <h1>Signup Page</h1> <br />
      <Textfield id={"name"} label={"Name"} type={"text"} /> <br />
      <Textfield id={"email"} label={"Email"} type={"text"} /> <br />
      <Textfield id={"password"} label={"Password"} type={"password"} /> <br />
      <Textfield
        id={"confirmPassword"}
        label={"Confirm Password"}
        type={"password"}
      />{" "}
      <br />
      <NativeSelect onChange={rolechange} />
      {/* <Button label={"Sign Up"} onClick={(e) => signupHandle(e)} /> <br />
       */}
      <Link label={"Login"} path={"/"} />
    </div>
  );
}

export default Signup;
